Mongodb sort by in array<p>Is there a way to sort by a given array?</p>

<p>something like this:</p>

<pre><code>const somes = await SomeModel.find({}).sort({'_id': {'$in': [ObjectId('sdasdsd), ObjectId('sdasdsd), ObjectId('sdasdsd)]}}).exec()
</code></pre>

<p>What i looking for is a way to get a solution, to get all document of the collection and sort by if the document's _id match with one of the given array.</p>

<p>An example:</p>

<p>we have albums collection and songs collection. In albums collection we store the ids of the songs that belongs to the albums.</p>

<p>I want to get the songs, but if the song is in the album take them front of the array.</p>

<p>I solved this as follow, but its looks a bit hacky:</p>

<pre><code>const songs = await SongMode.find({}).skipe(limit * page).limit(limit).exec();
const album = await AlbumModel.findById(id).exec();

if(album) {
    songArr = album.songs.slice(limit * page);

    for(let song of album.songs) {
        songs.unshift(song);
        songs.pop();
    }
}
</code></pre>

