How to return the list value outside from mongoose find<p>Im using MongoDB database for tasks and im trying to find all the tasks with task_rating : "OK" and get the result into  one list and all tasks with task rating: "NOK" to second list and finaly render it to my HTML as two lists of information.</p>

<p>The problem is that whene I want to return the find results as list to outside value, it always returns me a weird object of Mongoose.</p>

<p>my code:</p>

<pre><code>app.get("/", function(req, res) {
    var nok_l = tasks.find({ task_rating: "NOK" }, (err, nokTasks) =&gt; {
        if (err)
            console.log(err);
        else {
            return nokTasks;
        }
    });
    var ok_l = tasks.find({ task_rating: "OK" }, (err, okTasks) =&gt; {
        if (err)
            console.log(err);
        else {
            return okTasks;
        }
    });

    console.log(ok_l);
    res.render("tasks", {
         ok_l: ok_l,
         nok_l: nok_l
     });
});
</code></pre>

<p>the result of the console.log print is werid object of Mongoose and not my list.</p>

<p>Thank you.</p>

