<pre><code>db.events.insert(
   [
     { _id: 1, name: "Amusement Ride", description: "Fun" },
     { _id: 2, name: "Walk in Mangroves", description: "Adventure" },
     { _id: 3, name: "Walking in Cypress", description: "Adventure" },
     { _id: 4, name: "Trek at Tikona", description: "Adventure" },
     { _id: 5, name: "Trekking at Tikona", description: "Adventure" }
   ]
)
</code></pre>

<p>I've also created a index in a following way:</p>

<pre><code>db.events.createIndex( { name: "text" } )
</code></pre>

<p>Now when I execute the following query (Search - Walk):</p>

<pre><code>db.events.find({
    '$text': {
        '$search': 'Walk'
    },
})
</code></pre>

<p>I get these results:</p>

<pre><code>{ _id: 2, name: "Walk in Mangroves", description: "Adventure" },
{ _id: 3, name: "Walking in Cypress", description: "Adventure" }
</code></pre>

<p>But when I search Trek:</p>

<pre><code>db.events.find({
    '$text': {
        '$search': 'Trek'
    },
})
</code></pre>

<p>I get only one result:</p>

<pre><code>{ _id: 4, name: "Trek at Tikona", description: "Adventure" }
</code></pre>

<p>So my question is why it dint resulted:</p>

<pre><code>{ _id: 4, name: "Trek at Tikona", description: "Adventure" },
{ _id: 5, name: "Trekking at Tikona", description: "Adventure" }
</code></pre>

<p>When I searched walk it resulted the documents containing both walk and walking. But when I searched for Trek it only resulted the document including trek where it should have resulted both trek and trekking</p>

